window.bookSummaryJSON = "<p><b><i>Tempest Borne</i></b><b> is the short story prelude to the suspense filled Treborel Series!</b></p> <p>Mikel returns from a journey across the vast Tempest Sea to announce his engagement only to discover his long time mistress, Zannia is with child.</p> <p>After Zannia's attempt at blackmail fails, she disappears into the war-torn landscape of Latria, determined Mikel will never see his child again.</p> <p>Will his new fiance, Sari support the search for his unborn child or is this the end of his new beginning?</p>"; 
